import Expenses from "./Components/Expenses";
function App() {
  const expenses = [{title: 'Car Insurance', amount: '245.65',date: new Date(2021, 2, 28)},
  {title: 'Car Insurance', amount: '245.65',date: new Date(2021, 2, 28)},
  {title: 'Car Insurance', amount: '245.65',date: new Date(2021, 2, 28)}];
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items={expenses}/>
    </div>
  );
}

export default App;
